import React from 'react';
import './App.css';
import {Router, Link} from 'react-router-dom'
import homepage from './routes/homepage'
import login from './routes/login'

function App() {
  return (
    <Router>
    <div className="App">
      <Link to="/" component={homepage} />
      <Link to="/login" component={login} />

    </div>
    </Router>
  );
}

export default App;
